import React from 'react'
import {
  Link
} from "react-router-dom";
import Contact from './utils/Contact';
import Home from './utils/Home';
function App(){
  return (
    <>

      <div>
        <nav>
          <ul>
            <li>
              <Link to="/Home"><Home/></Link>
            </li>
            <li>
              <Link to="/contact"><Contact/></Link>
            </li>
          </ul>
        </nav>
      <h4>This is App.tsx page</h4>
      </div>
</>
  );
}
export default App;
